  'Body': '\nAviva \n\nIf this email doesn\'t display correctly, \nclick here :\nhttp://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/hosted?track=avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL&t_params=FNAME%!D(MISSING)Return%!R(MISSING)EMOVE%!D(MISSING)rm-0bx6rw3raupta74au6m0rxbysph09qe%!a(MISSING)vivaemail.co.uk\n\nAVIVA - Your Aviva Essentials http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/avivalp \n\nMotor : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/carlp \n\nHome : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/homelp \n\nTravel : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/travelp \n\nBreakdown : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/breakdlp \n\nDear Return,\n\nWelcome to Your Aviva Essentials, our customer newsletter jam-packed\nwith tips and advice. What are you planning for the Easter holidays? If\nit\'s DIY or a family break we\'ve got lots of great tips and inspiration.\n\n\nIn this issue of the Aviva eZine:\n\nKeep the cost of driving down\nTop 5 family days out\nTop 5 DIY checks\nThe latest security guidelines for travellers\nStreet to school - Sarah\'s* story\n\nPS Thanks for all your previous feedback, check out the cost savings tips\nwe have put together for you. \nTell us more : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/complp?CLIENTID= about what you think of the\neZine.\n\nhttp://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/complp?CLIENTID= \n\nKeep the cost of driving down: be green\n\nSave money at the pumps and go further on one tank of petrol with our\ngreen driving tips, brought to you in association with experts at the\nRAC. You could see a 15%!f(MISSING)uel efficiency improvement.\n\nRead our money-saving tips : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/costfelp \n\nKeep the cost of driving down: be green http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/costfelp \n\nTop 5 family days out \n\nThe long bank holiday can only mean one thing – fun day trips! We\'ve put\ntogether our top 5 days out under £100 – and a couple of tips to survive\nany long car journeys with the kids. \n\nTop 5 family days out : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/motorfelp \n\nDays out with kids http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/motorfelp \n\nTop 5 DIY checks: get your house in order this Easter\n\nPlanning to decorate this Easter holiday? Make sure you\'ve got the\ngroundwork right first with our 5 helpful DIY checks. Even better, make\nthe checks an annual habit and you\'ll sleep easier knowing there\'s less\nchance any unwelcome surprises will surface.\n\nCheck out our 5 DIY checks : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/homefelp  \n\nUp-to-date security travel advice\n\nGoing away? Saunter through the airports – and ensure you\'re able to\nkeep those luxury items in your handbag – by reading the latest security\nguidelines. Plus, what to do if you\'re ill while you\'re away.\n\nThe latest security guidelines : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/travelfelp \n\nUp-to-date security travel advice http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/travelfelp \n\nStreet to school - Sarah\'s* story\n\nWe\'ve partnered with Railway Children, a charity who dedicates its work\nto helping vulnerable children like Sarah who are at risk on our\nstreets. Sarah was reunited with her family and is now at college,\nthanks to support from Railway Children. \n\nRead about Street-to-school : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/sponsorlp \n\nStreet-to-school - Sarah\'s* story http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/sponsorlp \n\nWin 4 tickets to the Rubgy Premiership Final http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/complp?CLIENTID= \n\nWin one of 3 sets of 4 tickets to the Aviva Premiership Rugby Final at\nTwickenham Stadium on 28 May 2011 \n\nEnter now http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/complp?CLIENTID= \n\nWinner of the November competition : TBC \n\nJoan Beesley, Merseyside, won a Sony HD TV and Blu-Ray player.\n"The prize was brilliant, we were amazed at winning such a fantastic\nprize and would just like to say thank you to everyone at Aviva" : TBC \n\nEnter now : TBC \nTop tips for getting fit at home TBC \n\nMy Policy\n\nMy Policy http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/mypollp \n\nRegister for My Policyto: \n\nCheck your policy details\n\nMake a claim\n\nChange your cover\n\nRenew your policy online\n\nBenefit from an exclusive package of travel, leisure and high street\noffers.\n\nMy Policy : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/mypollp \n\nOnline tools\n\nUpdate your policy : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/mypollp \n\nHome contents calculator : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/concalclp \n\nRoute planner : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/routelp \n\nMy claims app for iPhone : http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/claimslp \n\nFacebook http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/fbooklp \n\nDigg http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/digglp \n\nTwitter http://avivaemail.co.uk/a/tBNld25AWKyy7B8Z$5RAAAAAAcL/twitterlp \n\n* Sarah is a fictious name, used to protect the individual\'s identity\n\nIf you would prefer not to receive any further marketing information\nfrom Aviva by email, simply send a \nblank email to us : mailto:rm-0bx6rw3raupta74au6m0rxbysph09qe@avivaemail.co.uk . \nThis email and any files sent with it are intended only for the named\nrecipient. If you are not the named recipient please telephone/email the\nsender immediately. You should not disclose the content or\ntake/retain/distribute any copies. \n\nAviva Insurance UK Limited, Registered Office: 8 Surrey Street, Norwich\nNR1 3NG. Registered in England No. 99122. Authorised and regulated by\nthe Financial Services Authority. \n\nNFPZZA00011 Mar11\n',
